import React, { Component } from 'react'
import PropTypes from 'prop-types';

export class DeleteDialog extends Component {
    render() {
        return (
            <div id="modal_yes_no_dialog_background_hide">
                <div id="modal_dialog">
                    Delete List?
            <div id="delete_dialog_box_question">Are you sure you want to delete this list?</div>
                    <div id="list_delete_buttons">
                        <button id="list_delete_list">Yes</button>
                        <button id="list_cancel_delete_list">No</button>
                    </div>
                    <div>The list will not be retrievable.</div>
                </div>
            </div>
        )
    }
}

export default DeleteDialog
